import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = ()=>{

    return (
        <>
        <div>

        </div>
            <h2>Login</h2>
            <form >
                <input type='text'/>
                <Button as='input' type="button"/>{' '}
            </form>

        </>
    )
}

export default Login;
